import React from "react";
import { Box, Typography } from "@mui/material";

const LandingPage: React.FC = () => {
    return (
        <Box
            sx={{
                height: "100vh",
                width: "100%",
                backgroundColor: "#fbeee6", // Light beige background
                display: "flex",
                justifyContent: "space-between",
                alignItems: "center",
                padding: "2rem",
            }}
        >
            {/* Vertical Name Section */}
            <Box sx={{ textAlign: "left" }}>
                <Typography
                    variant="h1"
                    sx={{
                        color: "#4A2040", // Dark purple color
                        lineHeight: 1.2,
                        fontWeight: "bold",
                    }}
                >
                    I<br />V<br />A<br />P<br />A<br />R<br />K
                </Typography>
            </Box>

            {/* Introduction Section */}
            <Box sx={{ maxWidth: "40%" }}>
                <Typography
                    variant="h5"
                    sx={{
                        color: "#000", // Black color
                        fontWeight: "bold",
                        marginBottom: "1rem",
                    }}
                >
                    Hello there,
                </Typography>
                <Typography
                    sx={{
                        color: "#000",
                        fontSize: "1.2rem",
                        lineHeight: 1.6,
                    }}
                >
                    I am a UI/UX designer passionate about turning complex ideas into intuitive, engaging experiences. I combine design and technology to create solutions that meaningfully connect with users.
                </Typography>
            </Box>
        </Box>
    );
};

export default LandingPage;
